amento per garanzie prodotti', 0, 0, 0, 0, 0, 0, 0, '', 0, '', '', 0.00, '', '', '', '', '', '0000-00-00', '0000-00-00', 0, 0.00, 0, 0.0, 0, 1, 0, 'EB00013', '', '', '', '', '2007-05-18 08:46:32'),(330000002, 0, 'Materie sussidiarie c/acquisti', 0, 0, 0, 0, 0, 0, 0, '', 0, '', '', 0.00, '', '', '', '', '', '0000-00-00', '0000-00-00', 0, 0.00, 0, 0.0, 0, 0, 0, 'EB00006', '', '', '', 'amministratore', '2008-10-07 10:29:57'),(210000009, 0, 'Riserva conguaglio utili in corso', 0, 0, 0, 0, 0, 0, 0, '', 0, '', '', 0.00, '', '', '', '', '', '0000-00-00', '0000-00-00', 0, 0.00, 0, 0.0, 0, 1, 0, '', 'PA07000', '', '', '', '2007-05-18 08:46:32'),(330000003, 0, 'Materie di consumo c/acquisti', 0, 0, 0, 0, 0, 0, 0, '', 0, '', '', 0.00, '', '', '', '', '', '0000-00-00', '0000-00-00', 0, 0.00, 0, 0.0, 0, 0, 0, 'EB00006', '', '', '', 'amministratore', '2008-10-07 10:30:09'),(338000011, 0, 'Accantonamento per manutenzioni programmate', 0, 0, 0, 0, 0, 0, 0, '', 0, '', '', 0.00, '', '', '', '', '', '0000-00-00', '0000-00-00', 0, 0.00, 0, 0.0, 0, 1, 0, 'EB00013', '', '', '', '', '2007-05-18 08:46:32'),(101000000, 0, 'IMMOBILIZZAZIONI IMMATERIALI', 0, 0, 0, 0, 0, 0, 0, '', 0, '', '', 0.00, '', '', '', '', '', '0000-00-00', '0000-00-00', 0, 0.00, 0, 0.0, 0, 1, 0, '', '', '', '2426, 1): «Le immobilizzazioni sono iscritte al costo di acquisto o di produzione. Nel costo di acquisto si computano anche i costi accessori. Il costo di produzione comprende tutti i costi direttamente imputabili al prodotto. Può comprendere anche altri costi, per la quota ragionevolmente imputabile al prodotto, relativi al periodo di fabbricazione e fino al momento dal quale il bene può essere utilizzato; con gli stessi criteri possono essere aggiunti gli oneri relativi al finanziamento della fabbricazione, interna o presso terzi»

2426, 5): «I costi di impianto e di ampliamento, i costi di ricerca, di sviluppo e di pubblicità aventi utilità pluriennale possono essere iscritti nell`attivo con il consenso del collegio sindacale [omissis]»

2426, 6): «L`avviamento può essere iscritto nell`attivo con il consenso del collegio sindacale, se acquisito a titolo oneroso, nei limiti del costo per esso sostenuto [omissis]»

Il costo del software indispensabile al funzionamento dell`hardware, quale può essere il sistema operativo, viene patrimonializzato insieme all`hardware.
Il costo del software applicativo va in bilancio nella voce BI3 dell`attivo (diritto di brevetto e di utilizzazione delle opere dell`ingegno), se si tratta di un lavoro prodotto in economia e tutelato dalle norme sul diritto d`autore, se l`acquisto comporta l`acquisizione del diritto d`autore, ma anche se se si tratta di una licenza d`uso a tempo indeterminato.
Il costo del software applicativo va invece in bilancio nella voce BI4 (concessioni, licenze, marchi e diritti simili) se si tratta di una licenza d`uso a tempo determinato, con pagamento in un`unica soluzione.
Se invece il software è stato prodotto in economia, ma senza che i diritti su questo lavoro possano essere sfruttati diversamente, il suo costo va in bilancio alla voce BI7 (altre immobilizzazioni immateriali).

