DROP TABLE IF EXISTS `gaz_currencies`;
CREATE TABLE `gaz_currencies` (
  `id` int(3) NOT NULL AUTO_INCREMENT,
  `curr_name` varchar(50) DEFAULT NULL,
  `symbol` varchar(3) NOT NULL,
  `html_symbol` varchar(10) NOT NULL,
  `decimal_place` char(4) DEFAULT NULL,
  `decimal_symbol` char(4) DEFAULT NULL,
  `thousands_symbol` char(4) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

LOCK TABLES `gaz_currencies` WRITE;
INSERT INTO `gaz_currencies` ( `id`,`curr_name`,`symbol`,`html_symbol`,`decimal_place`,`decimal_symbol`,`thousands_symbol`) VALUES (1, 'euro', '€ ', '&#8364 ', '2', ',', '.');
UNLOCK TABLES;

DROP TABLE IF EXISTS `gaz_currency_history`;
CREATE TABLE `gaz_currency_history` (
  `id_currency` int(9) NOT NULL,
  `change_value` decimal(12,5) NOT NULL,
  `date_reference` date NOT NULL,
  `id_currency_obj` int(9) NOT NULL
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `gaz_languages`;
CREATE TABLE `gaz_languages` (
  `lang_id` int(3) unsigned NOT NULL AUTO_INCREMENT,
  `lang_code` char(7) NOT NULL,
  `title` varchar(50) NOT NULL,
  `title_native` varchar(50) NOT NULL,
  `sef` varchar(50) NOT NULL,
  `image` varchar(50) NOT NULL,
  `description` varchar(512) NOT NULL,
  `metakey` text NOT NULL,
  `metadesc` text NOT NULL,
  `published` int(11) NOT NULL DEFAULT '0',
  `ordering` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`lang_id`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

